    // Ajouter un écouteur d'événement au clic sur le bouton hamburger\n      menuBtn.addEventListener('click', () => {\n        // Vérifier si le menu déroulant a été trouvé\n        if (menuList) {\n          if (!menuIsOpen) {\n            // Afficher le menu déroulant\n            menuList.style.display = 'block';\n            menuIsOpen = true;\n            \n            // Masquer le menu déroulant après un délai de 8 secondes\n            setTimeout(() => {\n              menuList.style.display = 'none';\n              menuIsOpen = false;\n            }, 8000);\n          } else {\n            // Masquer le menu déroulant\n            menuList.style.display = 'none';\n            menuIsOpen = false;\n          }\n        }\n      });\n    }\n\n    // Ajouter un écouteur d'événement pour le survol des éléments de menu\n    //const menuItems = document.querySelectorAll('.menu-item') as NodeListOf;\n    //if (menuItems) {\n    //  menuItems.forEach((menuItem) => {\n    //    menuItem.addEventListener('mouseover', () => {\n    //      menuItem.style.borderBottom = '3px solid orange';\n    //    });\n    //    menuItem.addEventListener('mouseout', () => {\n    //      menuItem.style.borderBottom = 'none';\n    //    });\n    //  });\n    //}\n  }\n\n}\n    \n\n    \n        \n\n    \n      CRYPTO COIN SCANNER\n    \n      -->\n    \n        \n        \n          About us\n          \n          FAQ\n          \n          Contact\n          \n        \n      \n      \n    \n      CRYPTO COIN SCANNER\n      \n      Crypto Coin Scanner is a website that allows crypto enthusiasts to quickly and easily compare the prices of various cryptocurrencies across multiple exchanges. With real-time data from top exchanges like Binance, Coinbase, and Kraken, users can stay up-to-date on the latest market trends and make informed decisions about their crypto investments. The website's user-friendly interface and intuitive design make it easy to navigate and find the information yo